$_MODULE['<{onboarding}prestashop>backoffice_top_79b0fcd70b51a3065ebbfe7e953eae38'] = 'Kiểm tra danh mục của chúng tôi để có được một chủ đề mới hoặc tùy biến chủ đề mặc định hiện tại. [1] Thêm logo của bạn, chơi trên phông chữ và màu sắc... Cung cấp cho cái nhìn đặc biệt này đến cửa hàng của bạn!';
