$_MODULE['<{onboarding}prestashop>backoffice_top_0429b4766bfd2e6540dc3cb5537387ff'] = 'Chọn phương thức thanh toán bạn muốn cung cấp cho khách hàng về cửa hàng của bạn, và quản lý các hạn chế khác nhau mà bạn có thể áp dụng (mỗi tiền tệ, quốc gia hoặc nhóm khách hàng).';
